import React from 'react';
import { StyledCell } from './styles/StyledCell';
import { TETROMINOS } from "../tetrominos";

const Cell = ( { type }) => (
    <StyledCell type={type} color={TETROMINOS['L'].color}/>
)

export default Cell;
